	children: <ReadAgain label="Read Again" />,
	bookData: data,
};

export const AddToLibrary = Template.bind({});

const allProps = {
	width: "284px",
	height: "52px",
	children: "Add to library",
	startIcon: (
		<AddIcon
			sx={{ height: "24px", display: "flex", position: "relative", top: "5px" }}
		/>
	),
};

